import React, { Component } from 'react'

const INITIAL_STATE = {
    articles: [],
    filterArticle: "",
    filter: "",
    isLoaded: "",
    error: {},
}

class Articles extends Component {
    constructor(props) {
        super(props);
        this.state = INITIAL_STATE;
    }

    componentDidMount() {

        fetch("http://henri-potier.xebia.fr/books")
            .then(data => this.setState({...this.state, books: data.json()}))
            .catch(err => this.setState({...this.state, error: err}))
    }

    render() { 
